  // '/Users/evanbacon/Documents/GitHub/lab/yolo5/node_modules/react-native-reanimated/ios/Nodes/REACallFuncNode.m'
  const [, modulePath] = filePath.split('/node_modules/');
  if (modulePath) {
    return moduleNameFromPath(modulePath);
  }
  return null;
}
